module.exports = "<div class=\"subService\">\n    <div class=\"subService__banners\">\n        <div class=\"subService__banners__content\">\n          <div class=\"row\">\n            <div class=\"col-xs-12  col-sm-8\">\n                <h1 class=\"hero\">Docker and Container Platforms</h1>\n                <div class=\"subService__banners--border\">\n                  <div class=\"dot\"></div>\n                  <div class=\"line\"></div>\n                </div>\n                <button id=\"consultaion\" class=\"subService__banners__content__button\"><a href=\"#contact\" target=\"_blank\"><span class=\"subService__banners__content__button__text\">Schedule a consultaion</span></a></button>  \n            </div>\n            <div class=\"col-xs-12  col-sm-4\">\n              <div class=\"subService__banners__img\">\n              </div>\n            </div>\n          </div>\n          \n        </div>\n      </div>\n  \n      <div class=\"subService__overview\">\n        <p class=\"h1 subService__overview__heading\">Overview</p>\n        <p class=\"b2\">Docker containers wrap a piece of software in a complete filesystem that contains everything needed to run: code, runtime, system tools, system libraries - anything that can be installed on a server.</p>\n        <p class=\"b2\">This ensures that the software will always run the same, regardless of its environment.</p>\n      </div>\n  \n      <div class=\"subService__challenge\">\n        <div class=\"subService__challenge__main\">\n          <p class=\"h1 subService__challenge__main__heading\">Current challenge</p>\n          <p class=\"b2\">The useful lifetime of a legacy application may be considerably longer than that of the platform on which it was originally developed or delivered. If you have such an app, it makes sense to adapt it to current infrastructure platforms (such as containers) when possible.  </p>\n           <p class=\"b2\">Thatâs more efficient than rewriting the entire application each time a new type of infrastructure becomes available.  Containerising legacy applications can also add much needed speed and agility to applications that still need to be changed.  </p>\n        </div>\n      </div>\n  \n      <div class=\"subService__solve\">\n          <div class=\"subService__solve__main\">\n            <p class=\"h1 subService__solve__heading\">How we solve</p>\n            <p class=\"b2\">We partner with enterprises organisations on their journey towards container-based application delivery, deployment and orchestration. We align with different stakeholders to understand the enterprise architure to design a governance model around the use of containers for successful and secure operational deployment.  </p>\n          </div>\n        </div>\n        <div class=\"subService__casestudy\">\n        <div class=\"subService__container\">\n            <div class=\"subService__container__heading h2\">Case Studies</div>\n            <div class=\"row\">\n            <div class=\"subService__container__card col-xs-12 col-sm-4\">\n              \n              <div class=\"subService__container__card__img subService__container__card__card1\"></div>\n              <div class=\"subService__container__card__text h3\">Explore the future of design and creativity.</div>\n          </div>\n            <div class=\"subService__container__card col-xs-12 col-sm-4\">\n                \n              <div class=\"subService__container__card__img subService__container__card__card2\"></div>\n              <div class=\"subService__container__card__text h3\">Explore the future of design and creativity.</div>\n          \n          </div>\n            <div class=\"subService__container__card col-xs-12 col-sm-4\">\n              <div class=\"subService__container__card__img subService__container__card__card3\"></div>\n              <div class=\"subService__container__card__text h3\">Explore the future of design and creativity.</div>\n          </div>\n          </div>\n          <button id=\"viewMore\" class=\"subService__container__button\"><a href=\"#casestudy\"><span class=\"subService__container__button__text\">View More</span></a></button>\n          </div>\n        </div>\n  \n        <app-suits></app-suits>\n        <div class=\"subService__moreServices\">\n          <div class=\"subService__moreServices__heading h2\">Look into our more services</div>\n  \n          <app-service-carousel></app-service-carousel>\n        </div>\n  </div>"

